import React from 'react'
import Todo from './Todo'

type Props = {
    todo: Todo
}

const SingleTodo = ({todo}: Props) => {
  return (
    <form className='todos__single'>
        <span className="todos__single--text">
            {todo.name}
        </span>
    </form>
  )
}

export default SingleTodo
